     "type": "html",
     "name": "question49",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you agree for you and or your child to participate, we will ask you to take part in completing\none to two visits, either during your pregnancy, at less than 1 month of age for your child, or\nbetween 3-9 months of age for your child. These visits will take place in-person, or some parts\nmay be done remotely. The length of visits will vary, and may last between approximately one to\nseven hours per visit (which can be broken up into multiple visits). This will include completing\ninterviews, questionnaires and other tests about yourself and or your child for the visits that are\nplanned for the first year of the study. We may have your child wear a small device for a few\ndays to measure movement. We may ask you and or your child to provide some biological\nsamples. Because this study is looking at how a child’s brain develops in the first years of life,\nwe may ask that you allow your child to have brain scans and other measures of how your\nchild’s brain is developing.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"> The most serious potential risks of the study are the social and legal risks that could result the loss of your or your child’s confidentiality if we mistakenly share your information with someone outside the study. Every effort will be made to protect your confidentiality. All records collected from you and your child will be identified by unique study ID and will not carry personal identifiers.</p>\n\n<p><br /></p><h4 style=\"text-align:Leftt\">\nVersion 08/23/2022</h4><p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
