    {
     "type": "html",
     "name": "question19",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If your child were to have a brain MRI, these visits would be scheduled at the MRI Imaging Center at\nAtrium Health Wake Forest Baptist in Winston-Salem. The study team will make you aware if your\nchild will receive an MRI for the study. We will give you directions and free parking as applicable\nBecause MRI involves being placed in a strong magnetic field, it is not safe for your child to be in or\nnear an MRI scanner if they have metal on their body, such as pierced earrings. You will be asked to\nremove anything metallic from your child before the scan.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The EEGs will be done at the MRI Imaging Center in Winston-Salem. Your child will wear a\nspecial head “net” or cap for a brief period of time while doing the study tasks.</p>"
    }
