    {
     "type": "html",
     "name": "question64",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b>\nWhat About Your and Your Child’s Health Information?</b> </h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">\nIn this research study, any new information we collect from you or information we get from your\nmedical records or other facilities about your health or behaviors is considered Protected Health\nInformation. The information we will collect for this research study may include: MRI results,\nEEG results, surveys and questionnaires, ECG results, biospecimens (i.e., whole blood, serum,\nplasma, nails, saliva, urine, stool), your and your child’s medical records.<br /><br />\nIf this research study involves the diagnosis or treatment of a medical condition, then Protected\nHealth Information collected from you during this study will be placed in your medical record,\nand may be used to help treat you, arrange payment for your care, or assist with Medical Center\noperations.<br /><br />\nWe will make every effort to keep your Protected Health Information private. We will store\nrecords of your Protected Health Information in a cabinet in a locked office or on a password\nprotected computer.<br /><br />\nYour personal health information and information that identifies you (“your health information”)\nmay be given to others during and after the study. This is for reasons such as to carry out the\nstudy, to determine the results of the study, to make sure the study is being done correctly, to\nprovide required reports and to get approval for new products.<br /><br />\nSome of the people, agencies and businesses that may receive and use your health information are\nthe research sponsor; representatives of the sponsor assisting with the research; investigators at\nother sites who are assisting with the research; central laboratories, reading centers or analysis\ncenters; the Institutional Review Board; representatives of Wake Forest University Health\nSciences and North Carolina Baptist Hospital; representatives from government agencies such as\nthe Food and Drug Administration (FDA) or the Office of Human Research Protections (OHRP),\nthe Department of Health and Human Services (DHHS) and similar agencies in other countries,\nUCSD and the NIH.<br /><br />\nSome of these people, agencies and businesses may further disclose your health information. If\ndisclosed by them, your health information may no longer be covered by federal or state privacy\nregulations. Your health information may be disclosed if required by law. Your health information\nmay be used to create information that does not directly identify you. This information may be\nused by other researchers. You will not be directly identified in any publication or presentation\nthat may result from this study unless there are photographs or recorded media which are\nidentifiable.<br /><br />\nMonitors, auditors, IRB of record or other regulatory agencies will be granted direct access to the\nparticipant’s original medical record for verification of clinical trial procedures or data, without\nviolating confidentiality of the participant and to the extent permitted by other applicable laws.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page19.2",
   "elements": [
    {
     "type": "html",
     "name": "question66",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If required by law or court order, we might also have to share your Protected Health Information\nwith a judge, law enforcement officer, government agencies, or others. If your Protected Health\nInformation is shared with any of these groups, it may no longer be protected by federal or state\nprivacy rules.<br /><br />\nAny Protected Health Information collected from you in this study that is maintained in the\nresearch records will be kept for at least six years after the study is finished. At that time any\nresearch information not already in your medical record will either be destroyed or it will be deidentified.\nAny research information entered into your medical record will be kept for as long as\nyour medical record is kept by the Medical Center. You will not be able to obtain a copy of your\nProtected Health Information in the research records until all activities in the study are completed.<br /><br />\nYou can tell the study doctor that you want to take away your permission to use and share your\nProtected Health Information at any time by sending a letter to the study doctor’s address listed on\nthe first page of this form.<br /><br />\nHowever, if you take away permission to use your Protected Health Information you will not be\nable to be in the study any longer. We will stop collecting any more information about you, but\nany information we have already collected can still be used for the purposes of the research study.<br /><br />\nBy signing this form you give us permission to use your Protected Health Information for this\nstudy.<br /><br />\nLaboratory test results and other medical reports created as a result of your participation in the\nresearch study may be entered into the computer systems of Wake Forest University Health\nSciences and North Carolina Baptist Hospital. These will be kept secure, with access to this\ninformation limited to individuals with proper authority, but who may not be directly involved\nwith this research study.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page19.3",
   "elements": [
    {
     "type": "html",
     "name": "question17",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b>\nWill you receive any results about yourself or your child from participating in this study?</b> </h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">While the study will not provide medical care, if the answers you give us in some of the questionnaires\nsuggest that you are having serious problems with your mental health, we will let you know, and assist\nyou in finding help. If your child receives an MRI and there is something the study doctors notice\nwhen looking at your child’s MRI scan that might need further evaluation, we will let you know and\nassist you in deciding what you can do next.</p>"
    }
   ],
