     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other\nquestions or research-related problems, you may reach Dr. Shenberger at 336.716.6097.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">\nYou may call the Chairman of the IRB at (336) 716-4542 or the Research Subject Advocate at\n(336) 716-8372 to inquire about your or your child’s rights as a research subject or to report\nresearch-related problems.</p>\n\n"
