{
 "pages": [
  {
   "name": "page1",
   "elements": [
    {
     "type": "html",
     "name": "question1",
     "html": "<h4 style=\"text-align:Right\">\nSTUDY0019548</h4>\n<h4 style=\"text-align:Right\">\nScreening Script</h4><br />\n<h3 style=\"text-align:right\"><p>\nWake Forest University School of Medicine</p></h3>\n<h4 style=\"text-align:right\"><p>\nScreening Script</p>\n<h3 style=\"text-align:center\"><p><b>\nScreening Script with Consent</b></p></h3>\n<h4 style=\"text-align:center\"><p><b>\nThe HEALthy Brain and Child Development (HBCD) Study</b></p></h4></h4>"
    },
    {
     "type": "text",
     "name": "firstName",
     "title": "Potential Participant First Name",
     "hideNumber": true,
     "isRequired": true,
     "readOnly": true,
     "surveyVariable": "ParticipantVariable:firstName"
    },
    {
     "type": "text",
     "name": "lastName",
     "startWithNewLine": false,
     "title": "Potential Participant Last Name",
     "hideNumber": true,
     "isRequired": true,
     "readOnly": true,
     "surveyVariable": "ParticipantVariable:lastName"
    },
    {
     "type": "text",
     "name": "customID",
     "title": "Potential Participant ID",
     "hideNumber": true,
     "readOnly": true,
     "surveyVariable": "StudyInfoVariable:customId"
    },
    {
     "type": "text",
     "name": "Person Conducting Screening Interview",
     "title": "Person Conducting Screening Interview",
     "hideNumber": true,
     "isRequired": true
    },
    {
     "type": "text",
